import React from "react"

export const Generating_Business_icon = (props) =>{

        const Despenser = (props) => {
            switch(typeof props.object[props.page]){
                case('object'): return <li className='Business_icon_Components'> {props.object[props.page].userId} </li>
                case(undefined): return <li className='Business_icon_Components'> 'preparing...' </li>
            }

        }

        switch(typeof props.object){
            case(undefined): 
            
            return <React.Fragment>
                {Despenser(props)}
            </React.Fragment>
            case('object'): 
            
            return <React.Fragment>
            <li className='Business_icon_Components'> {props.object[props.page].userId} </li>
            <li className='Business_icon_Components'> {props.object[props.page+1].userId} </li>
            <li className='Business_icon_Components'> {props.object[props.page+2].userId} </li>
            <li className='Business_icon_Components'> {props.object[props.page+3].userId} </li>
            <li className='Business_icon_Components'> {props.object[props.page+4].userId} </li>
            <li className='Business_icon_Components'> {props.object[props.page+5].userId} </li>
            <li className='Business_icon_Components'> {props.object[props.page+6].userId} </li>
            <li className='Business_icon_Components'> {props.object[props.page+7].userId} </li>
            </React.Fragment>
        }
    }


export default Generating_Business_icon
